import styled from "styled-components";

export const DivForm = styled.div`
  border: solid;
  display: flex;
  width: 22%;

  flex-direction: column;

  form {
    display: flex;
    flex-direction: column;
  }

  input {
    border-radius: 5px;
    width: 329.93px;
    height: 48px;
  }
`;
